import React, { useState } from 'react'
import './signUp.css'
import useForm from './useForm'
import validate from './SignUPFormValidation'
import Navbar from '../About/Navbar'
import url from '../../url/config'
import NetworkErr from '../NetworkError'
import { Redirect } from 'react-router-dom'
import { fetchPost } from '../../fetch'

function SignUp () {
  const [status, setStatus] = useState('')
  const [resMsg, setResMsg] = useState({})
  const [userAcc, setAcc] = useState([])
  const [netErr, setNetErr] = useState(false)
  const { handleChange, handleSubmit, values, errors } = useForm(
    login,
    validate
  )

  const fetchReq = async (url, card) => {
    const response = await fetchPost(url, card)
    if (response.err) {
      setNetErr(true)
    } else {
      const responseMsg = await response.json()
      setStatus(response.ok)
      setResMsg(responseMsg)
    }
  }

  function login () {
    fetchReq(`${url}/createAccount`, values)
    setAcc([...userAcc, values])
  }

  return (
    <>
      {netErr &&
        <NetworkErr />}
      {!netErr &&
        <div className='signup-page'>
          <Navbar login='logIn' />
          <section className='signup-box'>
            <h1 className='heading'>Create a new account</h1>
            <p className='sub-heading'>It's free and always will be.</p>
            <form className='signup-form' onSubmit={e => handleSubmit(e)}>
              <label htmlFor='username' className='label'>Username</label>
              <input
                type='text'
                placeholder='Enter your name'
                id='username'
                name='user_name'
                className={`input${errors.user_name && 'invalid'}`}
                onChange={e => handleChange(e)}
                value={values.user_name || ''}
              />
              {errors.user_name && (
                <p className='invalid-para'>{errors.user_name}</p>
              )}
              <label htmlFor='email' className='label'>
            Your Email
              </label>
              <input
                type='email'
                placeholder='Enter your Email'
                id='email'
                name='user_email'
                className={`input${errors.user_email && 'invalid'}`}
                onChange={e => handleChange(e)}
                value={values.user_email || ''}
              />
              {errors.user_email && (
                <p className='invalid-para'>{errors.user_email}</p>
              )}
              <label htmlFor='pswd' className='label'>
            New Password
              </label>
              <input
                type='password'
                id='pswd'
                name='pswd'
                className={`input${errors.pswd && 'invalid'}`}
                placeholder='Enter the password'
                onChange={e => handleChange(e)}
                value={values.pswd || ''}
                minLength='6'
              />
              {errors.pswd && <p className='invalid-para'>{errors.pswd}</p>}
              <button className='signup-btn'>Sign Up </button>
            </form>
            {status && resMsg.error && (
              <p className='acc-exist-already'>
            Sorry, an account with this email address already exists.
              </p>
            )}
            {status && resMsg.success && (
              <Redirect to='/login' />
            )}
          </section>
        </div>}
    </>
  )
}

export default SignUp
